def guardar_usuarios_diccionario(usuarios):
    diccionario_usuarios = {}
    contador: int = 0
    for i, usuario in enumerate(usuarios):
        if(usuario["active"] == True):
            contador += 1
            nombre = usuario['displayName']
            id_usuario = usuario['accountId']
            diccionario_usuarios[str(i + 1)] = {
                'nombre': nombre,
                'idUsuario': id_usuario
            }
            print(f"""
                Numero: {str(i+1)} - {contador}
                Usuario: {diccionario_usuarios[str(i+1)]['nombre']}
                Id de Usuario: {diccionario_usuarios[str(i+1)]['idUsuario']
                    
                    }""")
        
        
        
    return diccionario_usuarios

guardar_usuarios_diccionario(usuarios)